						</div>
						<div className="list_info">
								<div className="i_name">{this.state.lname}</div>
								<div className="i_job">job</div>
								<div className="i_job">position</div>     
						</div>
					</div>
			</div>
		);
	}
}
const app = document.getElementById("list")

